import React, {useState} from 'react';
import SignIn from './components/signIn';
import SignUp from './components/signUp';

function App() {
  return (
        <div>
          <SignUp />
          <SignIn />
        </div>
  );
  const extandNavBar = () => {
    this.setState({buttonClick: this.state.buttonClick + 1});  
    let col;
    col = (this.state.buttonClick % 2 == 0) ? document.getElementById( "signUp" ).style.display = "none": document.getElementById( "a" ).style.display = "block";
    return col;

  }
}


export default App;
